import "./App.css";

// Custom components
import Login from "./Components/Login.js"
import MedicationInput from "./Components/MedicationInput.js";
import MenuAppBar from "./Components/MenuAppBar.js";
import Nav from "./Components/Nav.js";
import RegisterReminder from "./Components/RegisterReminder.js";

import {BrowserRouter, Route, Routes} from "react-router-dom";
import Typography from "@mui/material/Typography";

const doseSuggestions = [
    {label: "10"},
    {label: "20"},
    {label: "30"},
    {label: "40"},
    {label: "50"},
    {label: "60"},
    {label: "70"},
    {label: "80"}
];

const medicationSuggestions = [
    {label: "Lisinopril"},
    {label: "Valsartan"}
];

export default function App() {
    // Styles and SX
    const typographyMedicationSx = {
        mb: 4,
        textAlign: "center"
    }

    return (
        <BrowserRouter>
            <div className="App">
                <Routes>
                    <Route exact path="/" element={
                        <div className="Login">
                            <Login/>
                        </div>
                    }/>

                    <Route exact path="/add-medication" element={
                        <div>
                            <MenuAppBar/>
                            <div className="Container">
                                <Typography sx={typographyMedicationSx} variant="h4">
                                    What is the name of your medication?
                                </Typography>

                                <MedicationInput/>
                            </div>
                        </div>
                    }/>

                    <Route exact path="/main-menu" element={
                        <div>
                            <MenuAppBar/>
                            <div className="Container">
                                <Nav/>
                            </div>
                        </div>
                    }/>
                </Routes>

            </div>
        </BrowserRouter>
    );
}
